(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["other-data"],{"0173":function(r,n,t){"use strict";t.r(n),n["default"]="## 图片懒加载？\r\n\r\n当页面滚动的时间被触发 -> 执行加载图片操作 -> 判断图片是否在可视区域内 -> 在，则动态将data-src的值赋予该图片"},"0982":function(r,n,t){"use strict";t.r(n),n["default"]="## HTTP和HTTPS，为什么HTTPS安全，HTTP1.0、HTTP1.1、HTTP2.0区别\r\n\r\n收集中...\r\n\r\nHTTP协议通常承载与 TCP协议之上，在HTTP和TCP之间添加一个安全协议层（SSL或TSL），这个时候，就成了我们常说的HTTPS\r\n\r\n默认HTTP的端口号为80，HTTPS的端口号为443\r\n\r\n因为网络请求需要中间有很多的服务器路由的转发，中间的节点都可能篡改信息，而如果使用HTTPS，密钥在你和终点站才有，https之所有说比http安全，是因为他利用ssl/tls协议传输。包含证书，流量转发，负载均衡，页面适配，浏览器适配，refer传递等，保障了传输过程的安全性"},"0ee0":function(r,n,t){"use strict";t.r(n),n["default"]="## event loop 是什么，事件怎么循环，宏任务和微任务是什么有哪些以及执行顺序？\r\n\r\nxxx"},"25c4":function(r,n,t){"use strict";t.r(n),n["default"]="## 项目中遇到哪些难题以及如何解决？\r\n\r\nxxx"},"29c6":function(r,n,t){"use strict";t.r(n),n["default"]="## 聊一聊tree shaking\r\n\r\n收集中..."},"2a3f":function(r,n,t){"use strict";t.r(n),n["default"]="## HTTP常见的状态码？\r\n\r\n- 100 Continue 继续，一般在发送post请求时，已发送了http header之后服务端将返回此信息，表示确认，之后发送具体参数信息\r\n- 200 OK 正常返回信息\r\n- 201 Created 请求成功并且服务器创建了新的资源\r\n- 202 Accepted 服务器已接受请求，但尚未处理\r\n- 301 Moved Permanently 请求的网页已永久移动到新位置。\r\n- 302 Found 临时性重定向。\r\n- 303 See Other 临时性重定向，且总是使用 GET 请求新的 URI。\r\n- 304 Not Modified 自从上次请求后，请求的网页未修改过。\r\n- 400 Bad Request 服务器无法理解请求的格式，客户端不应当尝试再次使用相同的内容发起请求。\r\n- 401 Unauthorized 请求未授权。\r\n- 403 Forbidden 禁止访问。\r\n- 404 Not Found 找不到如何与 URI 相匹配的资源。\r\n- 500 Internal Server Error 最常见的服务器端错误。\r\n- 503 Service Unavailable 服务器端暂时无法处理请求（可能是过载或维护）。"},"2bab":function(r,n,t){"use strict";t.r(n),n["default"]="## 白屏问题\r\n\r\n收集中..."},"2bb6":function(r,n,t){"use strict";t.r(n),n["default"]="## 单例模式以及应用场景\r\n\r\nxxx"},"402c":function(r,n,t){"use strict";t.r(n),n["default"]="## 常见的浏览器内核有哪些？\r\n\r\n主要分成两部分：渲染引擎(layout engineer或Rendering Engine)和JS引擎。\r\n\r\n- 渲染引擎：负责取得网页的内容（HTML、XML、图像等等）、整理讯息（例如加入CSS等），以及计算网页的显示方式，然后会输出至显示器或打印机。浏览器的内核的不同对于网页的语法解释会有不同，所以渲染的果也不相同。所有网页浏览器、电子邮件客户端以及其它需要编辑、显示网络内容的应用程序都需要内核。\r\n- JS引擎则：解析和执行javascript来实现网页的动态效果。\r\n- 最开始渲染引擎和JS引擎并没有区分的很明确，后来JS引擎越来越独立，内核就倾向于只指渲染引擎。\r\n\r\n常见内核\r\n\r\n- Trident 内核：IE, MaxThon, TT, The World, 360, 搜狗浏览器等。[又称 MSHTML]\r\n- Gecko 内核：Netscape6 及以上版本，FF, MozillaSuite / SeaMonkey 等\r\n- Presto 内核：Opera7 及以上。 [Opera内核原为：Presto，现为：Blink;]\r\n- Webkit 内核：Safari, Chrome等。 [ Chrome的：Blink（WebKit 的分支）]"},"533d":function(r,n,t){"use strict";t.r(n),n["default"]="## 聊聊cdn以及cdn的调度系统\r\n\r\n收集中..."},"6a77":function(r,n,t){"use strict";t.r(n),n["default"]="## 后端一次性返回数据，列表不用分页，前端如何优化显示，虚拟列表是什么？\r\n\r\nxxx"},7506:function(r,n,t){"use strict";t.r(n),n["default"]="## DOM事件对象target和currentTarget有什么区别？\r\n\r\n- `target` 事件目标\r\n- `currentTarget` 当前事件处理程序所在的元素"},"765d":function(r,n,t){"use strict";t.r(n),n["default"]="## 文件上传原生如何实现，进度如何显示，断点续传，以及上传过程中刷新页面的解决办法？\r\n\r\nxxx"},"77a6":function(r,n,t){"use strict";t.r(n),n["default"]="## 聊一聊csrf以及防御方法\r\n\r\n收集中..."},8035:function(r,n,t){"use strict";t.r(n),n["default"]="## 移动端性能优化？\r\n\r\n- 尽量使用css3动画，开启硬件加速\r\n- 适当使用touch事件代替click事件\r\n- 避免使用css3渐变阴影效果\r\n- 可以用transform: translateZ(0) 来开启硬件加速\r\n- 不滥用float。float在渲染时计算量比较大，尽量减少使用\r\n- 不滥用web字体。web字体需要下载，解析，重绘当前页面\r\n- 合理使用requestAnimationFrame动画代替setTimeout\r\n- css中的属性（css3 transitions、css3 3D transforms、opacity、webGL、video）会触发GUP渲染，耗电"},"91c1":function(r,n,t){"use strict";t.r(n),n["default"]="## axios原理，以及axios中如何取消请求\r\n\r\n收集中..."},9729:function(r,n,t){"use strict";t.r(n),n["default"]="## 你做过的关于性能优化方面的\r\n\r\n1. 压缩 css, js, 图片\r\n2. 减少 http 请求次数， 合并 css、js 、合并图片（雪碧图）\r\n3. 使用 CDN\r\n4. 减少 dom 元素数量\r\n5. 图片懒加载\r\n6. 静态资源另外用无 cookie 的域名\r\n7. 减少 dom 的访问（缓存 dom）\r\n8. 巧用事件委托\r\n9. 样式表置顶、脚本置低"},"98e1":function(r,n,t){"use strict";t.r(n),n["default"]="## 线程与进程的区别？\r\n\r\n- 一个程序至少有一个进程,一个进程至少有一个线程.\r\n- 线程的划分尺度小于进程，使得多线程程序的并发性高。\r\n- 另外，进程在执行过程中拥有独立的内存单元，而多个线程共享内存，从而极大地提高了程序的运行效率。\r\n- 线程在执行过程中与进程还是有区别的。每个独立的线程有一个程序运行的入口、顺序执行序列和程序的出口。但是线程不能够独立执行，必须依存在应用程序中，由应用程序提供多个线程执行控制。\r\n- 从逻辑角度来看，多线程的意义在于一个应用程序中，有多个执行部分可以同时执行。但操作系统并没有将多个线程看做多个独立的应用，来实现进程的调度和管理以及资源分配。这就是进程和线程的重要区别。"},a5b9:function(r,n,t){"use strict";t.r(n),n["default"]="## 怎么知道一个页面是否卡顿\r\n\r\n收集中..."},ab1f:function(r,n,t){"use strict";t.r(n),n["default"]="## 浏览器缓存有哪些？\r\n\r\n收集中..."},b4ff:function(r,n,t){"use strict";t.r(n),n["default"]="## code review 怎么做？\r\n\r\nxxx"},e533:function(r,n,t){"use strict";t.r(n),n["default"]="## TCP 传输的三次握手、四次挥手策略\r\n\r\n三次握手：\r\n\r\n为了准确无误地吧数据送达目标处，TCP协议采用了三次握手策略。用TCP协议把数据包送出去后，TCP不会对传送后的情况置之不理，他一定会向对方确认是否送达，握手过程中使用TCP的标志：SYN和ACK\r\n\r\n- 发送端首先发送一个带SYN的标志的数据包给对方\r\n- 接收端收到后，回传一个带有SYN/ACK标志的数据包以示传达确认信息\r\n- 最后，发送端再回传一个带ACK的标志的数据包，代表“握手”结束\r\n\r\n如在握手过程中某个阶段莫明中断，TCP协议会再次以相同的顺序发送相同的数据包\r\n\r\n断开一个TCP连接需要“四次挥手”\r\n\r\n- 第一次挥手：主动关闭方发送一个FIN，用来关注主动方到被动关闭方的数据传送，也即是主动关闭方告诫被动关闭方：我已经不会再给你发数据了（在FIN包之前发送的数据，如果没有收到对应的ACK确认报文，主动关闭方依然会重发这些数据）。但是，此时主动关闭方还可以接受数据\r\n- 第二次挥手：被动关闭方收到FIN包后，发送一个ACK给对方，确认序号收到序号 +1（与SYN相同，一个 FIN占用一个序号）\r\n- 第三次挥手：被动关闭方发送一个 FIN。用来关闭被动关闭方到主动关闭方的数据传送，也就是告诉主动关闭方，我的数据也发送完了，不会给你发送数据了\r\n- 第四次挥手：主动关闭方收到FIN后，发送一个ACK给被动关闭方，确认序号为收到序号+1，至此，完成四次挥手"},f67c:function(r,n,t){"use strict";t.r(n),n["default"]="## 网页从输入网址到渲染完成经历了哪些过程？\r\n\r\n大致可以分为如下7步：\r\n\r\n- 输入网址；\r\n- 发送到DNS服务器，并获取域名对应的web服务器对应的ip地址；\r\n- 与web服务器建立TCP连接；\r\n- 浏览器向web服务器发送http请求；\r\n- web服务器响应请求，并返回指定url的数据（或错误信息，或重定向的新的url地址）；\r\n- 浏览器下载web服务器返回的数据及解析html源文件；\r\n- 生成DOM树，解析css和js，渲染页面，直至显示完成；"},f9e4:function(r,n,t){"use strict";t.r(n),n["default"]="## 聊一聊前端hooks\r\n\r\n收集中..."},fb39:function(r,n,t){"use strict";t.r(n),n["default"]="## 文件切片如何处理\r\n\r\nxxx"},fe40:function(r,n,t){"use strict";t.r(n),n["default"]="## 聊一聊前端监控和前端埋点\r\n\r\n收集中..."}}]);